%[text] # Matlab Tutorial: Visualizing and Analyzing Neural Time Series Data
%[text] Please see the Python tutorial for a detailed explanation of the example data and the analysis steps.
% Let's see the brain plot, by visualizing the picture '../media/brain_plot.png'
imshow('../media/P1_recon_with_elecs.png'); %[output:39459a4c]
brighten(0.5); %[output:39459a4c]
%%
%[text] ## Loading in the data
%[text] Let's start by loading in the data.
data = loadData(1, 1);

% What does the data structure have in it?
disp(data) %[output:7516873c]

% You can also explore data by double clicking on it in the Variable
% WorkSpace (with the Matlab GUI)
%%
%[text] ## Visualizing the data
%[text] We can visualize the data using the `plot` function.
x = (1:size(data.ecog, 2))/data.ecog_sr-0.5;
y = squeeze(mean(data.ecog, 1));
colors = [0.96 0.44 0.54; 0.74 0.60 0.19];

figure; %[output:611bfcf3]
for el = 1:2
    plot(x, y(:, el), 'LineWidth', 2, 'Color', colors(el, :));  %[output:611bfcf3]
    hold on;
end

% Format the plot
xlabel('Time (s)'); %[output:611bfcf3]
ylabel('Average electrical activity'); %[output:611bfcf3]
box off; %[output:611bfcf3]
set(gca, 'FontSize', 15); %[output:611bfcf3]
%%
%[text] ## Run PCA on the data
% First, we need to reshape the data
X = cat(1, data.ecog(:, :, 1), data.ecog(:, :, 2));

% What shape is X?
disp(size(X)) %[output:94c6ece9]

% Run PCA
[coeff, score, latent, ~, explained] = pca(X);

% Plot the trials in the first two principal components
figure; %[output:406a2fa3]
for el = 1:2
    scatter(score((el-1)*size(data.ecog, 1)+1:el*size(data.ecog, 1), 1), ... %[output:406a2fa3]
        score((el-1)*size(data.ecog, 1)+1:el*size(data.ecog, 1), 2), ... %[output:406a2fa3]
        50, colors(el, :), 'filled'); hold on; %[output:406a2fa3]
end
hold off; %[output:406a2fa3]

xlabel('PC1'); %[output:406a2fa3]
ylabel('PC2'); %[output:406a2fa3]

